import React from 'react';
import { useHistory } from 'react-router-dom';

function Header() {
    const history = useHistory();

    const handleAboutClick = () => {
        history.push('/about');
    };

    const handleTeamClick = () => {
        history.push('/team');
    };

    const handleYouthClick = () => {
        history.push('/youth');
    };

    return (
        <header>
            <div className="logo-container">
                <img
                    src="https://www.skrill.com/fileadmin/Personal/promotions/skrill-ac-milan/ac-milan.PNG"
                    alt="AC Milan Logo"
                    className="logo-img"
                />
                <span className="logo-text">AC Milan</span>
                <ul className="nav">
                    <li><button onClick={handleAboutClick}>Про клуб</button></li>
                    <li><button onClick={handleTeamClick}>Основна команда</button></li>
                    <li><button onClick={handleYouthClick}>Молодіжна команда</button></li>
                </ul>
            </div>
            <div className="presentation"></div>
        </header>
    );
}

export default Header;
